//If your script uses other assemblies you can reference them here:
//refAssemblies: System.dll, TCAdmin.SDK.dll,TCAdmin.GameHosting.SDK.dll, TCAdmin.TaskScheduler.SDK.dll

using System;
using System.Collections.Generic;
using TCAdmin.TaskScheduler.SDK.Objects;
public class CSharpScript : CSharpScriptBase
{

	public void Main() {
		// Check if we need to create the task
		// The task will be created if any one of the Java versions does not have an environment variable
		var javaVersions = new List<int> { 8, 11, 16, 17 };
		bool createTask = false;
		foreach (int javaVersion in javaVersions)
		{
			if(String.IsNullOrEmpty(Environment.GetEnvironmentVariable(String.Format("JAVA{0}", javaVersion))))
			{
				Script.WriteToConsole("Creating scheduled task to update Java versions");
                          	createTask = true;
				break;
			}
		}
		if(createTask)
		{
			DateTime today = DateTime.Today;
			int daysUntilMonday = ((int) DayOfWeek.Monday - (int) today.DayOfWeek + 7) % 7;
         	     	DateTime nextMonday = today.AddDays(daysUntilMonday);
			var rtask = new RecurringTask();
			rtask.UserId = ThisService.UserId;
			rtask.Name = "Update Java";
			rtask.Enabled = true;
			rtask.Source = ThisService.GetType().ToString();
			rtask.SourceId = ThisService.ServiceId.ToString();
			rtask.UserId = ThisService.UserId;
			rtask.Notes = "Created automatically - do not delete.\nThis Script will automatically update Java once per week.";

			var trigger = new Trigger();
			trigger.TriggerType = TriggerType.Weekly;
			trigger.Weekly = new TriggerWeekly();
			trigger.Weekly.StartTimeUtc = DateTime.SpecifyKind(nextMonday, DateTimeKind.Utc);
			trigger.Weekly.Days = Days.Monday;
			trigger.Weekly.RecurWeeks = 1;
			rtask.Triggers = new Trigger[] { trigger };

			var step = new RecurringStep();
			step.ModuleId = "d3b2aa93-7e2b-4e0d-8080-67d14b2fa8a9";
			step.ProcessId = 18;
			step.ServerId = ThisService.ServerId;
			var args = new TCAdmin.SDK.Database.XmlField();
			args["ScheduledScript.ServiceId"] = ThisService.ServiceId;
			args["ScheduledScript.ScriptId"] = "1";
			args["ScheduledScript.ForceExecution"] = false;
			args["ScheduledScript.WaitEmpty"] = true;
			args["ScheduledScript.SkipExecution"] = false;
			args["ScheduledScript.CheckSteamApiUpdate"] = true;
			step.Arguments = args.ToString();
			rtask.Steps = new RecurringStep[] { step };

			rtask.AppData["d3b2aa93-7e2b-4e0d-8080-67d14b2fa8a9"] = string.Format("<?xml version=\"1.0\" encoding=\"utf-16\" standalone=\"yes\"?><values>  <add key=\"ScriptId\" value=\"{0}\" type=\"System.String,mscorlib\" /></values>", args["ScheduledScript.ScriptId"]);
			rtask.GenerateKey();
			rtask.Save();
			rtask.ScheduleNextTask();
        	}
	}
}

"""
This script is a port of this: https://github.com/wisp-gg/images/blob/main/java/prompt.py (commit 233940f)
