import os
import glob
import sys
import signal
import struct
import zipfile
import hashlib
import json
from  platform import system

default = "Java 11"
entrypointMappings = {
    "Java 8": "java8",
    "Java 11": "java11",
    "Java 16": "java16",
    "Java 17": "java17"
}

#Set Automatic Java version if the variable doesn't exist.
if not 'ThisService_JavaVersion' in locals():
  ThisService_JavaVersion = 'Automatic'

def getHeader(data, header, separator = ":"):
  for x in data.split("\n"):
    splitted = x.strip().split(separator)
    if len(splitted) != 2:
      continue

    key, value = splitted
    if key.lower() == header.lower():
      return value.strip()

  raise Exception("Couldn't find header " + header)

def readClassHeader(zip, path):
    with zip.open(path) as class_data:
        header = class_data.read(4)
        if header != b"\xca\xfe\xba\xbe":
            raise Exception("Magic header of java class is not CAFEBABE?")

        class_data.read(2) # minor_version, we don't care about this
        major_version, = struct.unpack('>H', class_data.read(2))

        return major_version

def getJavaVersion(zip):
    # Some jars are already pre-built and their build tools just merge the mojang jar into it,
    # leading to some false positives. This tries to mitigate this by detecting the mojang jar inside.
    # TODO: Though for some reason, some of them could be built with Java 8, others with e.g. Java 16???
    max_version = 0
    for x in zip.namelist():
        if (x.startswith("net/minecraft/") or x.startswith("io/")) and x.endswith(".class"):
            max_version = max(max_version, readClassHeader(zip, x))
        # These two lines needs to be changed. Currently we just check if there's a folder called "META-INF/versions" that has a jar file. Really not happy about this way of checking, but it works right now.
        if x.startswith("META-INF/versions") and x.endswith(".jar"): 
            max_version = 61

    if max_version != 0:
        return max_version

    # Otherwise, fall back to the main class
    manifest_data = zip.read("META-INF/MANIFEST.MF").decode()
    main_class_path = getHeader(manifest_data, "Main-Class")

    return readClassHeader(zip, main_class_path.replace(".", "/") + ".class")

def getVersionFromPaperclip(zip):
    try:
        with zip.open("patch.properties") as patch_properties:
            return getHeader(patch_properties.read().decode(), "version", "=")
    except:
        pass

    try:
        with zip.open("patch.json") as patch_json:
            patch_contents = patch_json.read().decode()
            return json.loads(patch_contents)["version"]
    except:
        pass

    try:
        # the version.json manifest also has the java_version field but this is a bit inaccurate as we aren't guaranteed to have that version, so prefer our logic instead
        with zip.open("version.json") as version_json:
          version_contents = version_json.read().decode()
          return json.loads(version_contents)["id"]
    except:
        pass

def getPaperRecommendedVersion(zip):
    version = getVersionFromPaperclip(zip)
    if not version:
        return

    splitted = list(map(int, version.split(".")))
    major, minor = [splitted[0], splitted[1]]
    if major >= 1 and minor >= 17:
        return "Java 17"
    if major >= 1 and minor >= 16:
        return "Java 16"
    elif major >= 1 and minor >= 12:
        return "Java 11"
    elif major >= 1 and minor >= 8:
        return "Java 8"

def getJavaName(zip):
  # If we're able to detect that the server uses paper (or fork of it), prefer their recommended versions over target.
  try:
    paper_recommended = getPaperRecommendedVersion(zip)
    if paper_recommended:
      return paper_recommended
  except Exception as e:
    pass

  # Otherwise, just fallback to checking which version of java the files were built with.
  try:
    major_version = getJavaVersion(zip)
    if major_version >= 61:
      return "Java 17"
    elif major_version >= 60:
      return "Java 16"
    elif major_version >= 55:
      return "Java 11"
    else:
      return "Java 8"
  except Exception as e:
    pass

def search_jars(directory='.', extension=''):
    extension = extension.lower()
    for dirpath, dirnames, files in os.walk(directory):
        for name in files:
            if extension and name.lower().endswith(extension):
                return os.path.join(dirpath, name)
            elif not extension:
                return os.path.join(dirpath, name)  

startup = ThisService_CommandLineArguments
def getJarFromStartup():
    if not '-jar' in startup:
        return search_jars(os.path.join(ThisService_RootDirectory, 'libraries', 'net', 'minecraftforge', 'forge'), 'server.jar')
    splitted = startup.split(" ")
    for x in splitted:
        if x.strip().endswith(".jar"):
            return x.strip()

def main():
  java_folder = os.path.join(ThisService_RootDirectory, 'java')
  executable = '.exe' if system() == 'Windows' else ''
  content = ' %*' if system() == 'Windows' else ' $*'
  bash_shebang = '#!/bin/bash\n' if system() == 'Linux' else '' #On Linux, we need to add a shebang at the top of the .sh file

  jar = os.path.join(ThisService_RootDirectory, getJarFromStartup())
  if not jar:
    raise Exception('Your commandline does not include a jar file. Please select one.')
  else:
    Script.WriteToConsole('Current jar is %s' % str(jar))

  with zipfile.ZipFile(jar, "r") as zip:
    name = getJavaName(zip)
    if not name:
      name = default

  if ThisService_JavaVersion == 'Automatic':
    if entrypointMappings[name].upper() in os.environ:
      java_path = '\"%'+entrypointMappings[name].upper()+'%\"' if system() == 'Windows' else '\"${'+entrypointMappings[name].upper()+'}\"'
    elif os.path.isfile(os.path.join(java_folder, entrypointMappings[name], 'bin', 'java'+executable)):
      java_path = os.path.join(java_folder, entrypointMappings[name], 'bin', 'java'+executable)
    else:
      java_path = 'java'
    with open(ThisService_Executable, 'w') as file:
      file.write(bash_shebang + java_path + content)  
main()

import os
from platform import system

if not ThisService.Variables['JavaVersion'] == 'Automatic':
  def changeJavaVersion():
    executable = '.exe' if system() == 'Windows' else ''
    content = ' %*' if system() == 'Windows' else ' $*'
    bash_shebang = '#!/bin/bash\n' if system() == 'Linux' else '' #On Linux, we need to add a shebang at the top of the .sh file
    if ThisService.Variables['JavaVersion'].upper() in os.environ:
      java_path = '\"%'+ThisService.Variables['JavaVersion'].upper()+'%\"' if system() == 'Windows' else '\"${'+ThisService.Variables['JavaVersion'].upper()+'}\"'
    else:
      java_path = os.path.join(ThisService.RootDirectory, 'java', ThisService.Variables['JavaVersion'], 'bin', 'java'+executable) 
    with open(ThisService.Executable, 'w') as f:
      f.write(bash_shebang + java_path + content)

  java_folder = os.path.join(ThisService.RootDirectory, 'java')
  try:
    if not os.path.isdir(java_folder):
      Script.Execute(ThisGame.GameId, 1)
    changeJavaVersion()
  except Exception as e:
    raise Exception('Java version could not be set. Error was %s' % e)

Script.WriteToConsole('Your version of Java has been set to {}.'.format(ThisService.Variables["JavaVersion"].capitalize())) 
